import React, {Component} from 'react';
import { Text, View, Button } from 'react-native';
import styles from './Styles'

export default function Content() {
    return(
        <View>
            <Text style={styles.accent}>Off he goes, noncing again.</Text>
            <Text style={styles.accent}>Oh well, that's just... {onPressGiveName} for you</Text>
            <Button
                onTouch={onPressGiveName("Josh")}
                title="Josh"
                color="#841584"
                accessibilityLabel="Josh is a nonce"
                />
        </View>
    );
};
function onPressGiveName(Name) {
    if(Name === "Josh")
    {
        return(
            <Text>Josh</Text>
        );
    }       
}
